function loadKeywordResearchList() {
    console.log('start loadKeywordResearchList payingUser ' + payingUser);
    if (payingUser) {
        // if (payingUserOrFreeTrial && !isDev()) {
        console.log('loadKeywordResearchList real')
        $.getJSON(getApiUrl('getMyJsonIdeasKeyword'), function (json) {
            createKeywordsIdeaFromJson(json);
        });
    } else {
        createKeywordsIdeaFromJson(JSON.parse(keywordIdeas));
        if (!payingUserOrFreeTrial) {
        	$('.showRecommendedKeywordsUpgrade').show();
            $('table#keywordIdeasTable tbody tr').css('opacity', 0.3);
        }
    }
}

function addKeywordTrack(element, list, index) {
    if (payingUser) {
        console.log('addKeywordTrack index ' + index);
        var jsonPost = list[index];
        jsonPost = JSON.stringify(jsonPost);
        jsonPost = encodeURIComponent(jsonPost);
        console.log('jsonPost is ' + jsonPost);

        $.ajax({
            type: 'POST',
            url: getApiUrl('addToTrackWithGoogleValuesKeywordForWebsite'),
            data: 'keywordData=' + jsonPost,
            success: function (result) {
                if (result.status) {
                    if (result.status === 'limit' && !isShabbat) {
                        callUpgradePage();
                    } else {
                        showModal("Message", result.status, "Close", "");
                    }
                } else {
                    if (isSeolyUI) {
                        $(element).html('<i class="fas fa-check active class"></i>');
                        $(element).addClass("active");
                    } else {
                        $(element).html('<img src="/assets/images/home_icon/check-white.svg" alt="check">');
                        $(element).addClass("checked");
                    }

                    console.log(result);
                    refreshUsage();
                    needToRefreshKeywords = true;
                    // loadKeywordTable(true);
                    if (!shownBeforeKeywordAdded) {
                        if (isRabbitUI) {
                            fadeModalWithTime('', 'Great, Keyword was added, you can see it in the Keywords tab', 3000, true);
                        } else {
                            showModal("Success", "Keyword was added, you can see it in " + (isLinksUI ? "the Settings screen " : "My Keywords tab"), "Close", "");
                        }
                        setTimeout(function () {
                            $('#modalMessage').modal('hide');
                        }, 5000);
                        shownBeforeKeywordAdded = true;
                    }
                }
            },
            complete: function (result) {
                console.log(result);
            }
        });
        refreshUsage()
    } else {
        callUpgradePage();
    }
}
